import { useState } from 'react';
import './navBar.css';
export function NavBar({Route,setState}){

  const[hambug,sethambug]=useState('hambug')
    return (  
    <nav className='navbar'>
  
         <div className='nav-hambug' onClick={()=>sethambug('hambug-view')}>
              <svg width="2em" height="2em" viewBox="0 0 24 24"><path d="M4 6h16v2H4zm0 5h16v2H4zm0 5h16v2H4z" fill="white"></path></svg>
         </div>
         <div className='nav-name'>
            <a className='nav-link'>FT</a>
            <h2>FinTube</h2>
         </div>
         <div className={hambug}>
                        <div className='hambug-items'>
                            <a  onClick={()=>{
                              setState('Home')
                              sethambug('hambug')
                              }}>Home</a>
                            <a  onClick={()=>{
                              setState('Products')
                              sethambug('hambug')
                              }}>Explore</a>
                              <a>Watchlist</a>
                              <a>Liked Videos</a>
                              <a>Watch later</a>
                            <button className='hambug-close' onClick={()=>sethambug('hambug')}>X</button>
                        </div>
            </div>
         
               
      </nav>
    )
}
